 *
 * Author      : original: zilla774, modded by: wbar, hansengel
 * Created     : 23rd August 2009
 * Version     : 2.0
 * Website     : http://engel.uk.to
 * Description : Modifies facebook.com with a deviantART skin
 * Usage       : Use with Stylish Firefox extension (http://userstyles.org/) or copy to your Firefox userContent.css file
 */

@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("www.facebook.com"), url-prefix(https://register.facebook.com), url-prefix(http://register.facebook.com), url-prefix(http://apps.facebook.com) {

body {
    background-color: #728776 !important;
    padding-top: 0px !important;
}

/* *************** */
/*  Welcome page   */
/* *************** */

div#content {
    width: 684px !important;
}

div#menubar_container {
    width: 684px !important;
}

div#fb_menubar {
    background: transparent url(data:image/gif;base64,) no-repeat scroll left bottom !important;
    color: #f6eee2 !important;
    width: 684px !important;
    height: 100px !important;
}

.fb_menu_link {
    color: #f6eee2 !important;
}

div.fb_menubar_core ul.fb_menu_list {
    display: block !important;
    margin: 70px auto auto auto !important;
    text-align: center !important;
    width: 300px !important;
}

div.fb_menubar_aux {
    display: none !important;
}

div.WelcomePage_Container {
    background: transparent !important;
}

div.WelcomePage_MainSellCenter {
    width: 980px !important;
}

div.WelcomePage_MainSell {
    background: transparent !important;
}

div.WelcomePage_MainSellLeft {
    float: none !important;
    margin: 0 auto !important;
    text-align: center !important;
    width: 980px !important;
}

div.WelcomePage_MainMessage {
    color: #38473e !important;
}

div.WelcomePage_MainMap {
    display: none !important;
}

div.WelcomePage_MainSellRight {
    display: none !important;
}

/* Globals */

div.UIRoundedBox_Box {
    border: none !important;
}

/* Home page */

div#home_left_column {
    margin: 50px 0 0 20px !important;
    width: 620px !important;
}

div#home_filter_list {
    background-color: #cbd5d0 !important;
    padding: 10px !important;
    width: 126px !important;
}

div#home_stream {
    background-color: #d6ded4 !important;
    padding: 10px 10px 10px 14px !important;
    width: 450px !important;
}

/* Stream */

div.UIStory_First {
    border: none !important;
}

a.UIIntentionalStory_Pic {
    top: 5px !important;
}

div.UIIntentionalStory_Header, div.commentable_item {
    margin: 0 0 10px 10px !important;
}

/* Suggestions, Highlights, etc. */

div#home_sidebar {
    background-color: #cbd5d0 !important;
    padding: 10px !important;
    width: 250px !important;
}

/* Footer */

div#pagefooter {
    background: #4D625D url(data:image/jpeg;base64,%3D%3D) no-repeat scroll left top !important;
    border: none !important;
    height: 85px !important;
    line-height: 10px !important;
    margin-left: 410px !important;
    padding: 20px 5px 50px !important;
    width: 463px !important;
}

div.copyright_and_location {
    color: #98a8a3 !important;
    width: 300px !important;
}

div#pagefooter_copyright {
    color: #bbc2bb !important;
}

a.intl_selector_dialog_a {
    color: #98a8a3 !important;
}

div#pagefooter_links {
    line-height: 19px !important;
}

ul#pagefooter_left_links a {
    color: #98a8a3 !important;
}

ul#pagefooter_left_links span.bullet {
    display: none !important;
}

}
